// mocks useFetchDashboards.ts
// This must be used because of bug in the console backend that breaks Dev > Observe > Dashboards
// while running localhost.
export const mockUseFetchDashboards = (namespace: string): [Board[], string] => {
  //   const [boards, setBoards] = React.useState<Board[]>([]);
  //   const [error, setError] = React.useState<string>();

  let boards: Board[] = [];
  let error: string;

  let items = MonitoringDashboardConfigResponse.items;
  if (namespace) {
    items = _.filter(
      items,
      (item) => item.metadata?.labels['console.openshift.io/odc-dashboard'] === 'true',
    );
  }

  const getBoardData = (item): Board => {
    try {
      return {
        data: JSON.parse(_.values(item.data)[0]),
        name: item.metadata.name,
      };
    } catch (e) {
      error = `Could not parse JSON data for dashboard ${item.metadata.name}`;
      return { data: undefined, name: item?.metadata?.name };
    }
  };

  const newBoards = _.sortBy(_.map(items, getBoardData), (v) => _.toLower(v?.data?.title));
  boards = newBoards;

  return [boards, error];
};
